import React from 'react';
import './App.css';

function App() {
  return (
    <div
      className="bg-image"
      style={{
        backgroundImage: "url('/bg1.png')",
        minHeight: "100vh",
        width: "100vw",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        textAlign: "center"
      }}
    >
      <h1>Да-да, Нет-нет</h1>
      <p>Стартовая страница приложения.</p>
    </div>
  );
}

export default App;
